import { ValueConsumer } from '../../../Context';

class ItemsCount extends Component {
    render() {
        return (
            <ValueConsumer>
                {value => <p>{value.cart.count} items</p>}
            </ValueConsumer>
        )
    }
}

export default ItemsCount
